INSERT INTO cvterm VALUES (13, 7, 'Identifier', 'A text token, number or something else which identifies an entity, but which may not be persistent (stable) or unique (the same identifier may identify multiple things).', 13, 0, 0);
INSERT INTO cvterm VALUES (14, 7, 'Protein sequence', 'One or more protein sequences, possibly with associated annotation.', 14, 0, 0);
INSERT INTO cvterm VALUES (15, 7, 'Image', 'Biological or biomedical data has been rendered into an image, typically for display on screen.', 15, 0, 0);
INSERT INTO cvterm VALUES (16, 7, 'Map', 'A map of (typically one) DNA sequence annotated with positional or non-positional features.', 16, 0, 0);
INSERT INTO cvterm VALUES (17, 7, 'Genetic map', 'A map showing the relative positions of genetic markers in a nucleic acid sequence, based on estimation of non-physical distance such as recombination frequencies.', 17, 0, 0);
INSERT INTO cvterm VALUES (18, 7, 'Physical map', 'A map of DNA (linear or circular) annotated with physical features or landmarks such as restriction sites, cloned DNA fragments, genes or genetic markers, along with the physical distances between them. Distance in a physical map is measured in base pairs. A physical map might be ordered relative to a reference map (typically a genetic map) in the process of genome sequencing.', 18, 0, 0);
INSERT INTO cvterm VALUES (19, 7, 'Sequence coordinates', 'A position in a map (for example a genetic map), either a single position (point) or a region / interval.', 19, 0, 0);
INSERT INTO cvterm VALUES (20, 7, 'Database name', 'The name of a biological or bioinformatics database.', 20, 0, 0);
INSERT INTO cvterm VALUES (21, 7, 'Database ID', 'An identifier of a biological or bioinformatics database.', 21, 0, 0);
INSERT INTO cvterm VALUES (22, 7, 'URI', 'The name of a biological or bioinformatics database.', 22, 0, 0);
INSERT INTO cvterm VALUES (23, 7, 'Translation phase specification', 'Phase for translation of DNA (0, 1 or 2) relative to a fragment of the coding sequence.', 23, 0, 0);
INSERT INTO cvterm VALUES (24, 7, 'DNA sense specification', 'The strand of a DNA sequence (forward or reverse).', 24, 0, 0);
INSERT INTO cvterm VALUES (25, 7, 'Annotation track', 'Annotation of one particular positional feature on a biomolecular (typically genome) sequence, suitable for import and display in a genome browser. Synonym: Sequence annotation track.', 25, 0, 0);
INSERT INTO cvterm VALUES (26, 7, 'Phylogenetic tree', 'The raw data (not just an image) from which a phylogenetic tree is directly generated or plotted, such as topology, lengths (in time or in expected amounts of variance) and a confidence interval for each length.', 26, 0, 0);
INSERT INTO cvterm VALUES (27, 7, 'Species tree', 'A phylogenetic tree that reflects phylogeny of the taxa from which the characters (used in calculating the tree) were sampled.', 27, 0, 0);
INSERT INTO cvterm VALUES (28, 7, 'Gene tree', 'A phylogenetic tree that is an estimate of the character''s phylogeny.', 28, 0, 0);
INSERT INTO cvterm VALUES (29, 7, 'Phylogenetic tree visualisation', 'A phylogenetic tree that is an estimate of the character''s phylogeny.', 29, 0, 0);
INSERT INTO cvterm VALUES (30, 7, 'Sequence visualisation', 'Visualise, format or render a molecular sequence or sequences such as a sequence alignment, possibly with sequence features or properties shown.', 30, 0, 0);
INSERT INTO cvterm VALUES (31, 7, 'genome assembly', '', 31, 0, 0);
INSERT INTO cvterm VALUES (32, 7, 'Genome annotation ', '', 32, 0, 0);
INSERT INTO cvterm VALUES (33, 7, 'Analysis', 'Apply analytical methods to existing data of a specific type.', 33, 0, 0);
INSERT INTO cvterm VALUES (34, 8, 'instrument', 'An instrument is a device which provides a mechanical or electronic function.', 34, 0, 0);
INSERT INTO cvterm VALUES (36, 8, 'substrate type', 'Controlled terms for descriptors of types of array substrates.', 36, 0, 0);
INSERT INTO cvterm VALUES (37, 8, 'array manufacturer', '', 37, 0, 0);
INSERT INTO cvterm VALUES (35, 8, 'array design', 'An instrument design which describes the design of the array.', 35, 0, 0);
INSERT INTO cvterm VALUES (38, 9, 'database', 'A database is an organized collection of data, today typically in digital form.', 38, 0, 0);
INSERT INTO cvterm VALUES (39, 9, 'data acquisition', 'A technique that samples real world physical conditions and conversion of the resulting samples into digital numeric values that can be manipulated by a computer.', 39, 0, 0);
INSERT INTO cvterm VALUES (40, 10, 'rank order', 'A data item that represents an arrangement according to a rank, i.e., the position of a particular case relative to other cases on a defined scale.', 40, 0, 0);
INSERT INTO cvterm VALUES (41, 11, 'organism', 'A material entity that is an individual living system, such as animal, plant, bacteria or virus, that is capable of replicating or reproducing, growth and maintenance in the right environment. An organism may be unicellular or made up, like humans, of many billions of cells divided into specialized tissues and organs.', 41, 0, 0);
INSERT INTO cvterm VALUES (42, 11, 'assay', 'A planned process with the objective to produce information about the material entity that is the evaluant, by physically examining it or its proxies.', 42, 0, 0);
