INSERT INTO cvterm VALUES (44, 13, 'definition', 'The official OBI definition, explaining the meaning of a class or property. Shall be Aristotelian, formalized and normalized. Can be augmented with colloquial definitions.', 44, 0, 0);
INSERT INTO cvterm VALUES (45, 13, 'version number', 'A version number is an information content entity which is a sequence of characters borne by part of each of a class of manufactured products or its packaging and indicates its order within a set of other products having the same name.', 45, 0, 0);
INSERT INTO cvterm VALUES (46, 13, 'algorithm', 'An algorithm is a set of instructions for performing a paticular calculation.', 46, 0, 0);
