INSERT INTO cvterm VALUES (132, 42, 'software', 'Computer software, or generally just software, is any set of machine-readable instructions (most often in the form of a computer program) that conform to a given syntax (sometimes referred to as a language) that is interpretable by a given processor and that directs a computer''s processor to perform specific operations.', 132, 0, 0);
INSERT INTO cvterm VALUES (133, 44, 'unit', 'A unit of measurement is a standardized quantity of a physical quality.', 133, 0, 0);
