INSERT INTO cvterm VALUES (137, 45, 'Value', 'A numerical quantity measured or assigned or computed.', 137, 0, 0);
INSERT INTO cvterm VALUES (138, 45, 'Channel', 'An independent acquisition scheme, i.e., a route or conduit through which flows data consisting of one particular measurement using one particular parameter.', 138, 0, 0);
INSERT INTO cvterm VALUES (139, 45, 'Controlled Vocabulary', 'A set of terms that are selected and defined based on the requirements set out by the user group, usually a set of vocabulary is chosen to promote consistency across data collection projects. [ NCI ]', 139, 0, 0);
INSERT INTO cvterm VALUES (140, 45, 'Term', 'A word or expression used for some particular thing. [ NCI ]', 140, 0, 0);
INSERT INTO cvterm VALUES (141, 45, 'Expression', 'A combination of symbols that represents a value. [ NCI ]', 141, 0, 0);
INSERT INTO cvterm VALUES (142, 45, 'Phenotype', 'The assemblage of traits or outward appearance of an individual. It is the product of interactions between genes and between genes and the environment. [ NCI ]', 142, 0, 0);
INSERT INTO cvterm VALUES (143, 45, 'Genotype', 'The genetic constitution of an organism or cell, as distinct from its expressed features or phenotype. [ NCI ]', 143, 0, 0);
INSERT INTO cvterm VALUES (144, 45, 'Location', 'A position, site, or point in space where something can be found. [ NCI ]', 144, 0, 0);
INSERT INTO cvterm VALUES (145, 45, 'Reagent', 'Any natural or synthetic substance used in a chemical or biological reaction in order to produce, identify, or measure another substance. [ NCI ]', 145, 0, 0);
INSERT INTO cvterm VALUES (146, 45, 'Environment', 'The totality of surrounding conditions. [ NCI ]', 146, 0, 0);
INSERT INTO cvterm VALUES (147, 45, 'Tree Node', 'A term that refers to any individual item or entity in a hierarchy or pedigree. [ NCI ]', 147, 0, 0);
INSERT INTO cvterm VALUES (148, 45, 'Study Design', 'A plan detailing how a study will be performed in order to represent the phenomenon under examination, to answer the research questions that have been asked, and defining the methods of data analysis. Study design is driven by research hypothesis being posed, study subject/population/sample available, logistics/resources: technology, support, networking, collaborative support, etc. [ NCI ]', 148, 0, 0);
INSERT INTO cvterm VALUES (149, 45, 'Company', 'Any formal business entity for profit, which may be a corporation, a partnership, association or individual proprietorship.', 149, 0, 0);
INSERT INTO cvterm VALUES (150, 45, 'Project', 'Any specifically defined piece of work that is undertaken or attempted to meet a single requirement.', 150, 0, 0);
INSERT INTO cvterm VALUES (151, 45, 'DNA Library', 'A collection of DNA molecules that have been cloned in vectors.', 151, 0, 0);
INSERT INTO cvterm VALUES (152, 45, 'Trait', 'Any genetically determined characteristic.', 152, 0, 0);
INSERT INTO cvterm VALUES (153, 45, 'Subgroup', 'A subdivision of a larger group with members often exhibiting similar characteristics. [ NCI ]', 153, 0, 0);
