INSERT INTO cvterm VALUES (158, 52, 'sequence_feature', 'Any extent of continuous biological sequence.', 158, 0, 0);
INSERT INTO cvterm VALUES (159, 52, 'gene', 'A region (or regions) that includes all of the sequence elements necessary to encode a functional transcript. A gene may include regulatory regions, transcribed regions and/or other functional sequence regions.', 159, 0, 0);
INSERT INTO cvterm VALUES (160, 52, 'mRNA', 'Messenger RNA is the intermediate molecule between DNA and protein. It includes UTR and coding sequences. It does not contain introns.', 160, 0, 0);
INSERT INTO cvterm VALUES (161, 52, 'QTL', 'A quantitative trait locus (QTL) is a polymorphic locus which contains alleles that differentially affect the expression of a continuously distributed phenotypic trait. Usually it is a marker described by statistical association to quantitative variation in the particular phenotypic trait that is thought to be controlled by the cumulative action of alleles at multiple loci.', 161, 0, 0);
INSERT INTO cvterm VALUES (162, 52, 'sequence_variant', 'A sequence_variant is a non exact copy of a sequence_feature or genome exhibiting one or more sequence_alteration.', 162, 0, 0);
INSERT INTO cvterm VALUES (163, 52, 'genetic_marker', 'A measurable sequence feature that varies within a population.', 163, 0, 0);
INSERT INTO cvterm VALUES (164, 52, 'heritable_phenotypic_marker', 'A biological_region characterized as a single heritable trait in a phenotype screen. The heritable phenotype may be mapped to a chromosome but generally has not been characterized to a specific gene locus.', 164, 0, 0);
